import React ,{Component} from 'react';
import axios from 'axios';
import './App.css'
class blog extends Component{
    componentDidMount(){
        axios.get("https://jsonplaceholder.typicode.com/users")
    }
    render(){
        return(
<div>
<h2>This is a blog</h2>
<p>Please choose your blog !</p>
</div>


        );
    }
}
export default blog;
